Featuring Brooklyn Lee &amp; Maddy O'Reilly!

Old friends re-unite in this tale of private disclosures and self-discovery. Whether digging deep for inner-truth of temptation and transgression, or boldly accepting dares to explore new avenues of feminine passion, these four scenes are guaranteed to make anyone question their own limits of what they are ready to admit and what they are prepared to do. Directed by Dana Vespoli.
